package com.yaowang.entity;import java.io.Serializable;import java.util.Date;/** * 管理员登录日志表 *  * @author *  */public class LogAdminLogin implements Serializable {	private static final long serialVersionUID = 1L;	/**	 * id	 */	private String id;	/**	 * 用户id	 */	private String userId;	/**	 * 最后登录时间	 */	private Date loginTime;	/**	 * 最后登录ip	 */	private String loginIp;	/**	 * 用户	 */	private String userName;	/**	 * 设置id	 */	public void setId(String id) {		this.id = id;	}	/**	 * 获取id	 */	public String getId() {		return this.id;	}	/**	 * 设置用户id	 */	public void setUserId(String userId) {		this.userId = userId;	}	/**	 * 获取用户id	 */	public String getUserId() {		return this.userId;	}	/**	 * 设置最后登录时间	 */	public void setLoginTime(Date loginTime) {		this.loginTime = loginTime;	}	/**	 * 获取最后登录时间	 */	public Date getLoginTime() {		return this.loginTime;	}	/**	 * 设置最后登录ip	 */	public void setLoginIp(String loginIp) {		this.loginIp = loginIp;	}	/**	 * 获取最后登录ip	 */	public String getLoginIp() {		return this.loginIp;	}	public String getUserName() {		return userName;	}	public void setUserName(String userName) {		this.userName = userName;	}}